INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Sint omnis molestiae et tempora.', 'In id dolor labore itaque explicabo in. Et nulla commodi sapiente est et. Quidem vero quia mollitia inventore deserunt.', 'Illum nisi illo quidem. Non alias doloribus et nulla. Unde nihil et modi veniam hic. Qui nemo praesentium voluptates odio.', '2018-03-24');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Ratione possimus rerum dolores modi magni et.', 'Voluptas autem eos ipsa. Illo sunt voluptatem nisi iste facere pariatur quia. Ipsum ducimus corrupti illum consectetur tempora pariatur vel.', 'Cum nostrum nam nulla maiores rerum. Eligendi inventore eum similique vitae. Est autem eius consequatur vitae. Ut quia qui fuga.', '1999-12-26');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Voluptas autem neque illum quaerat.', 'Qui repudiandae consequatur officia et suscipit aperiam non. Laudantium vero et fuga cum beatae est. Fugit fuga possimus numquam. Est odio illo veritatis consequatur.', 'Animi architecto nam impedit in nobis qui. Qui dolore repudiandae beatae ratione eveniet est voluptatibus. Incidunt omnis dolorum distinctio nemo commodi voluptas ipsam.', '2005-04-27');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Neque fuga et eveniet harum dolore molestiae.', 'Veniam nulla provident maiores provident occaecati eaque. Maxime quod enim dolores sunt est temporibus facere.', 'Aliquam vel exercitationem id est qui. Et est blanditiis aut animi reiciendis reiciendis distinctio. Nihil qui nesciunt laborum nostrum natus.', '1990-11-12');
